{"commands": [{"bindings": {}, "collapsed": false, "command": "\n%md-sandbox\n\n<div style=\"text-align: center; line-height: 0; padding-top: 9px;\">\n  <img src=\"https://databricks.com/wp-content/uploads/2018/03/db-academy-rgb-1200px.png\" alt=\"Databricks Learning\" style=\"width: 1200px\">\n</div>", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "083d6fcb-47db-468b-9156-afa7a7b10399", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "4433fa77-8062-41b6-9a48-388e60fe89ae", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 1, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%md-sandbox\n<img src=\"https://files.training.databricks.com/images/Apache-Spark-Logo_TM_200px.png\" style=\"float: left: margin: 20px\"/>\n\n# Silver To Gold - 3 Days Rolling Total Volume\n\nRead the required Delta table and find the three-day rolling window of the top 10 tickers' total volume from September 2019.\n\n## In this exercise you will:\n* Learn to implement rolling `window` aggregations\n* Practice extracting row values using `collect`\n* Give data visualization a try on Databricks\n\n## Prerequisites\n* Web browser: **Chrome**\n* A cluster configured with **8 cores** and **DBR 7.0**", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "e2981407-e549-449e-8a90-57b8e3193cfe", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "312250de-6e62-40d2-9e98-ae2f732c1034", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 2, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%md-sandbox\n<h2 style=\"color:red\">Instructor Note</h2>\n\n\n\nThings to talk about:\n- talk about the goal: we would like to visualize how the top 10 ticker's trading changed over time in sept. 2019, we also smoothen the lines by applying a 3 day moving window\n- subqueries are available through the SQL API - you can ask them to solve the problem that way as a challange", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "0fd4f807-1de2-405b-99d3-6dee1b9560ea", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "44fb2e3a-cbbe-4727-83b3-83644176f43c", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 3, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%md\n## ![Spark Logo Tiny](https://files.training.databricks.com/images/105/logo_spark_tiny.png) Classroom-Setup<br>\n\nFor each lesson to execute correctly, please make sure to run the **`Classroom-Setup`** cell at the start of each lesson (see the next cell) and the **`Classroom-Cleanup`** cell at the end of each lesson.", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "165cd2a6-1145-4b98-a7d2-ce529dc9a47a", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "9e3cfe15-bdf1-4655-950c-f3099dbae1c7", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 4, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%run ./Includes/PCF-18G-ClassroomSetup", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "31064e48-d169-48c6-b16c-f69312506922", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "f5217050-3636-4913-82b9-1e410c016c40", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 5, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%md-sandbox\n\n## ![Spark Logo Tiny](https://files.training.databricks.com/images/105/logo_spark_tiny.png) Steps to complete<br>\nImplement the function **`challenge()`** to achieve the following:\n* Read Delta table from **`stockTransactionsPath`** to create the **`stockTransactions`** DataFrame.\n* Filter the DataFrame for September 2019 using the **`order_timestamp`** column\n* From the DataFrame, select the **`ticker`** and **`volume`** columns.\n* Group the DataFrame using the **`ticker`** column.\n* Aggregate the sum of the **`volume`** column and sort it in a descending order.\n* Assign the top ten tickers to a native list of  **`top_10_volume_tickers`**.\n* Find the three-day rolling total volume of tickers from the **`stockTransactions`** for September 2019.\n\n### Visual Comparison\nModify the output of the challenge() to display a Line Chart (this is an untestable requirement):\n1. Set Plot options keys to **`date`**, perform series groupings by ticker, and set values to three_day_total\n2. Aggregate by SUM\n\nThe expected diagrams should look similar to this:<br/>\n\n<img style=\"width: 50%;\" src=\"data:image/png;base64,\">\n\nThe resulting DataFrame schema should look like this:\n\n|name|type|\n|---|---|\n|date|TimestampType|\n|ticker|StringType|\n|three_day_total|LongType|", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "3a0b8697-ac54-4210-9ad2-4492cea8f287", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "c034ffb9-9659-4101-8e43-b7cc57c8daea", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 6, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "// ANSWER\n\ndef solution(spark:org.apache.spark.sql.SparkSession, stockTransactionsPath:String) : DataFrame = {\n  import org.apache.spark.sql.functions._\n  \n  // Read Delta table from `stockTransactionsPath` to create the `stockTransactions` DataFrame.\n  // Filter the DataFrame for September 2019 using the `order_timestamp` column\n  val stockTransactions = (spark.read.format(\"delta\").load(stockTransactionsPath)\n                          .filter((year(col(\"order_timestamp\")) === \"2019\") && (month(col(\"order_timestamp\")) === \"9\"))\n                          )\n\n  // From the DataFrame, select the \"ticker\" and \"volume\" columns.\n  // Group the DataFrame using the \"ticker\" column.\n  // Aggregate the sum of the \"volume\" column, sort it in a descending order.\n\n  // Assign the top ten tickers to a native list of top_10_volume_tickers.\n  val top_10_volume = (stockTransactions\n       .select(\"ticker\", \"volume\")\n       .groupBy(\"ticker\")\n       .agg(sum(col(\"volume\")).alias(\"total_volume\"))\n       .orderBy(desc(\"total_volume\"))\n       .select(\"ticker\") // only return a single column\n       .limit(10)\n       ).collect()\n  \n  val top_10_volume_tickers = top_10_volume.map(_.getString(0)) // the column returned 0 references\n  \n  // Calculate the three-day rolling total volume of these tickers for September 2019. Order by date and `ticker`.\n  val threeDaysRolling = (\n  stockTransactions\n  .filter(col(\"ticker\").isin(top_10_volume_tickers:_*))\n  .groupBy(window($\"order_timestamp\",\"3 days\",\"1 day\"), $\"ticker\")\n  .sum(\"volume\")\n  .orderBy(\"window.start\", \"ticker\")\n  .selectExpr(\"window.start as date\", \"ticker\", \"`sum(volume)` as three_day_total\")\n  \n  )\n\n  // Return the resulting DataFrame.\n  return threeDaysRolling\n}\n\nval finalDF = solution(spark, stockTransactionsPath)\n\n//\n// ### Visual Comparison ###\n//\n// Modify the output of solution() to display a Line Chart (this is an untestable requirement):\n//  * Set Plot options keys to `date`, perform series groupings by ticker, and set values to three_day_total\n//  * Aggregate by SUM\n//\n\ndisplay(finalDF)", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "e0f7e7b3-6610-4fdd-bfea-bdf211536525", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "d99a87af-10c3-4bd8-a62f-03cbaa01404c", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 7, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%md\n<h2><img src=\"https://files.training.databricks.com/images/105/logo_spark_tiny.png\"> Reality Check</h2>\n\nRun the following cell to make sure you are on track:", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "521575df-3d27-496a-9b40-23f74bb7e019", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "fe5a7e5d-b430-490f-92b5-8fff867cbddf", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 8, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "// ANSWER - Test your solution\nrealityCheck(solution, spark, stockTransactionsPath)", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "24d81660-87f5-4a58-9977-03aedbdf558c", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "1c4aed28-7071-4b6a-83a0-1dcb4fab40dd", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 9, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%md\n## ![Spark Logo Tiny](https://files.training.databricks.com/images/105/logo_spark_tiny.png) Classroom-Cleanup<br>\n\nRun